style.css:
@-moz-document domain("roblox.com") {
/* Container for the anime image and the share button */
    .anime-image-container {
        position: fixed;
        top: 20px;
        right: 20px;
        z-index: 1000;
        text-align: center;
        background-color: rgba(0, 0, 0, 0.6);
        padding: 10px;
        border-radius: 10px;
        box-shadow: 0 4px 10px rgba(0, 0, 0, 0.5);
    }

    .anime-image-container img {
        max-width: 250px;
        border-radius: 10px;
    }

    .share-button {
        margin-top: 10px;
        padding: 8px 15px;
        background-color: #ff4081;
        color: white;
        border: none;
        border-radius: 5px;
        cursor: pointer;
        font-size: 14px;
        transition: background-color 0.3s ease;
    }

    .share-button:hover {
        background-color: #e03070;
    }
}
